import React, { memo } from 'react'

import { hotDjradio } from '@/common/local-data.js'
import HotCoverInfo from '../artist-hot-composition/hot-cover-info'
import { HotDjradioWrapper } from './style'

export default memo(function HotDjradio() {
  return (
    <HotDjradioWrapper>
      <div className="header">
        <div className="settle-singer">入驻歌手</div>
      </div>
      <div className="artist-container">
        {hotDjradio.map(item => {
          return <HotCoverInfo key={item.picUrl} info={item} />
        })}
      </div>
    </HotDjradioWrapper>
  )
})
